// Can be a string as well. Need to ensure each key-value pair ends with ;


class AwesomeComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    loading: false
    };
  }

  onClick = () => {
  /*
    Begin by setting loading = true, and use the callback function
    of setState() to make the ajax request. Set loading = false after
    the request completes.
  */
  this.setState({ loading: true }, () => {})

}

  render() {
  const override = css`
  display: block;
  margin: 0 auto;
  border-color: red;
  loading: true;
  color: "red";
  css: "";
`;
    return (
      <div id="login" style = {{
                              margin:"0",
                              padding:"0",
                              backgroundColor:"#17a2b8",
                              height:"100vh"

                                  }}>
        <h3 class="text-center text-white pt-5"> SQ Signup form</h3>
        <div class="container" style={{marginTop:"120px", maxWidth:"600px",height:"320px",
                                        border: "1px solid #9C9C9C", backgroundColor:" #EAEAEA",
                                         padding:"20px", marginTop:"-5px"}}>
            <div id="login-row" class="row justify-content-center align-items-center">
                <div id="login-column" class="col-md-6">
                    <div id="login-box" class="col-md-12">
                        <form id="login-form" class="form" action="" method="post">
                            <h3 class="text-center text-info">Login</h3>
                            <div class="form-group">

                                <input type="text" name="username" id="username" class="form-control"/>
                            </div>
                            <div class="form-group">

                                <input type="text" name="password" id="password" class="form-control"/>
                            </div>
                            <div class="form-group">

                                <input type="submit" name="submit" class="btn btn-info btn-md" value="submit"/>
                            </div>
                            <div id="register-link" class="text-right">
                                <a href="#" class="text-info">Register here</a>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    </div>
    );
  }
}
 export default AwesomeComponent;
